INSERT INTO `contatos` VALUES (1,'FERNANDO HENRIQUE DE SOUZA','f.hsouza@hotmail.com','(11) 99910-0824','Dúvida','EU RESERVEI PARA EU E MAIS 2 PESSOAS, GOSTARIA DE SABER SE CADA PESSOA TEM QUE FAZER SUA RESERVA TB.',NULL,'2018-08-27 13:39:58','2018-08-27 13:39:58'),(2,'maria luiza silva','maludf1605@gmail.com','(61) 99224-7428','Contato Comercial','Boa Tarde, sou proprietária de um restaurante e gostaria de saber como promover uma promoção como essa do Entrecôte no meu estabelecer usando o voucher fácil.',NULL,'2018-08-30 13:49:52','2018-08-30 13:49:52'),(3,'Jéssica','jessicatonelli_@hotmail.com','(21) 98595-3129','Dúvida','Oi, boa tarde\r\nEu fiz 2 reservar para o Entrecote de Paris e gostaria de desmarcar.\r\nO que preciso fazer?\r\n\r\nObrigada!',NULL,'2018-08-31 12:07:41','2018-08-31 12:07:41'),(4,'Cristiane Miyuki Takara','cristiane.takara@gmail.com','(11) 99475-5640','Dúvida','Olá,\r\nQuanto ao voucher do L entrecote de Paris, tenho uma dúvida.\r\nIndo duas pessoas, necessário que ambas obtenham vouchers distintos? Em caso positivo, no campo do preenchimento de convidados, os dois devem preencher que irão acompanhados de mais uma pessoa?\r\nObrigada',NULL,'2018-08-31 18:45:09','2018-08-31 18:45:09'),(5,'Teste Testando','teste@teste.com','(11) 11111-1111','Contato Comercial','Teste',NULL,'2018-09-03 15:48:06','2018-09-03 15:48:06'),(6,'Josyane Neves','marketing@lellit.com.br','(11) 98203-8678','Contato Comercial','Olá, gostaríamos de cotar valores com vocês sobre a plataforma de voucher. Fico no aguardo',NULL,'2018-09-03 18:06:18','2018-09-03 18:06:18'),(7,'MARCELO TSUYOSHI YAMASHITA','dompedromarcelo@hotmail.com','(11) 98058-2728','Dúvida','gerei 3 voucher p o dia 8/9/2018 as 19hs mas nao consegui  imprimir e agora? preciso dos 3 codigos...Marcelo, Fabia e Angela',NULL,'2018-09-06 20:11:23','2018-09-06 20:11:23'),(8,'Thais Curty','thaiscurty88@gmail.com','(21) 96739-2731','Dúvida','Boa noite! Gostaria de saber se vocês aceitam o tickect Sodexo.\r\nObg',NULL,'20