oco meu e-mail é fone e ocorre erro ,como eu faço ou vcs já podem gerar nome Felipe Martins e Gabriel Martins\r\nObrigada',NULL,'2018-09-15 10:20:56','2018-09-15 10:20:56'),(24,'Antonio','carlos.orsatti@icloud.com','(11) 99166-9940','Dúvida','Fiz a reserva em São Caetano e não recebi o voucher pelo e-mail nem celular',NULL,'2018-09-15 19:19:28','2018-09-15 19:19:28'),(25,'Antonio','carlos.orsatti@icloud.com','(11) 99166-9940','Dúvida','Fiz a reserva em São Caetano e não recebi o voucher pelo e-mail nem celular',NULL,'2018-09-15 19:19:29','2018-09-15 19:19:29'),(26,'Ernesto Rubens Gelbcke','Ernestorg42@gmail.com','(11) 98321-1407','Dúvida','Efetuei a emissão de um voucher LDP50402 para o dia 30/9 as 20h e forneci o e-mail errado. Por favor, podem reenviar o voucher para o e-mail correto, acima mencionado.',NULL,'2018-09-16 10:07:37','2018-09-16 10:07:37'),(27,'Rogério Tadeu de oliveira','rogeriotolivrira@yahoo.com.br','(11) 9350-4818','Dúvida','Gostaria de saber se o valor promocioal e 1 por mesa ou cada pessoa tem o seu?',NULL,'2018-09-16 20:19:51','2018-09-16 20:19:51'),(28,'Bruna Pires','Brunanathalia@hotmail.com','(62) 99994-5656','Dúvida','Eu adquiri um voucher para hoje às 21:00 gostaria de saber se tenho que imprimir ou só o fato de eu chegar e me identificar já está tudo certo !',NULL,'2018-09-17 13:42:23','2018-09-17 13:42:23'),(29,'Mauricio','gb_barcellos@hotmail.com','(11) 98235-1076','Contato Comercial','Boa tarde, gostaria de saber como funciona a plataforma de vocês e os valores. \r\nAtt \r\nMauricio',NULL,'2018-09-17 17:52:36','2018-09-17 17:52:36'),(30,'Simone','simoneao@gmail.com','(11) 99752-9566','Outro','Prezados, Boa Noite! Gostaria de saber quando abrirão uma unidade aqui em Guarulhos (Sugiro no Shopping Maia rs) obrigada.',NULL,'2018-09-18 21:31:56','2018-09-18 21:31:56'),(31,'Igor bedrin martini','Igor.martini@hotmail.com','(11) 99908-2430','Dúvida','Olá gostaria de saber como fácil pra gerar o voucher fácil para aconpanhante',NULL,'2018-09-19 14:55:36','2018-09-19 14:55:36'),(32,'Ana cristina menezes lourenço','acml_2006@hotmail.com','(21) 98874-3709','Dúvida','Ctiança de oito anos tem q obter o voucher? No email da mãe?',NULL,'2018-09-20 09:05:41','2018-09-20 09:05:41'),(33,'Ana cristina menezes lourenço','acml_2006@hotmail.com','(21) 98874-3709','Dúvida','Ctiança de oito anos tem q obter o voucher? No email da mãe?',NULL,'2018-09-20 09:29:38','2018-09-20 09:29:38'),(34,'Raimond Silveira','gabyggz@hotmail.com','(62) 98251-0144','Dúvida','Não consigo imprimir meu voucher. Não encontrei o local para imprimir.\r\nO voucher é LPD47432',NULL,'2018-09-20 10:07:17','2018-09-20 10:07:17'),(35,'angelica','angelsmiz@hotmail.com','(11) 98107-0718','Dúvida','Bom dia,\r\nGostaria de poder comprar o voucher para dar o jantar para um casal. Isso é possível? \r\nObrigada',NULL,'2018-09-21 10:35:50','2018-09-21 10:35:50'),(36,'Mary','marynigri@gmail.com','(11) 99982-3313','Contato Comercial','falar sobre promocao, temos uma data definida se puderem retornar Qto antes\r\nobrigada',NULL,'2018-09-22 12:28:22','2018-09-22 12:28:22'),(37,'Júlio','Juliocesarjcrr@gmail.com','(11) 96245-1502','Dúvida','Boa tarde! Minha dúvida é a seguinte: pretendo ir com a esposa e a filha de 5 anos! É necessário colocar mais dois acompanhantes? Pergunto porque o sistema por interpretar 3 adultos, ou não?',NULL,'2018-09-22 14:02:09','2018-09-22 14:02:09'),(38,'Laís','lala.s.s@hotmail.com','(21) 97544-3771','Dúvida','Olá, gerei um voucher fazendo reserva pra duas pessoas. Meu acompanhante precisa gerar tb? Pois agora as vagas acabaram.',NULL,'2018-09-22 16:25:18','2018-09-22 16:25:18'),(39,'Laís','lala.s.s@hotmail.com','(21) 97544-3771','Dúvida','Olá, gerei um voucher fazendo reserva pra duas pessoas. Meu acompanhante precisa gerar tb? Pois agora as vagas acabaram.',NULL,'2018-09-22 16:25:20','2018-09-22 16:25:20'),(40,'Celso','Dr.costela@hotmail.com','(11) 99579-3568','Contato Comercial','Gostaria de maiores informacoes para utilizar em nosso