her, após a conclusão aparece uma mensagem dizendo ocorreu um erro.',NULL,'2018-09-27 22:36:15','2018-09-27 22:36:15'),(48,'Fernanda carvalheira','fernanda@bfcx.com.br','(24) 99901-3197','Outro','boa tarde gostaria de me cadastrar no voucher facil do entrecote da gavea para hoje a noite as 19.30 e nao estou conseguindo . mensGem de erro',NULL,'2018-09-28 16:14:46','2018-09-28 16:14:46'),(49,'Fernanda carvalheira','fernanda@bfcx.com.br','(24) 99901-3197','Outro','boa tarde gostaria de me cadastrar no voucher facil do entrecote da gavea para hoje a noite as 19.30 e nao estou conseguindo . mensGem de erro',NULL,'2018-09-28 16:15:23','2018-09-28 16:15:23'),(50,'Marco Galvao','marco@galvao.adm.br','(11) 99973-3800','Dúvida','boa noite, por fv, estou com uma duvida, estou comprando 6 lugares no restaurante l´entrecote, para ir com minha esposa e minhas 4 filhas. Porem, vi uma msg que cada um precisa retirar seu proprio voucher ?! como isso ? duas filhas são menores de idade ? eu nao posso retirar p/ toda familia ? por fv, gostaria de ajuda ! grato, att, Marco Galvao',NULL,'2018-09-28 22:11:35','2018-09-28 22:11:35'),(51,'Bruna','Brunamarim@hotmail.com','(11) 97267-6565','Dúvida','Oi, boa noite! Eu e meu namorado pegamos um voucher para o entrecote de Paris no sábado dia 29, mas não conseguimos mais acessá-lo para levar. Teria como tirar uma segunda via ou algo do tipo?',NULL,'2018-09-29 00:59:13','2018-09-29 00:59:13'),(52,'Adriana Eulalio','adriana@castroneves.com.br','(11) 98160-3322','Dúvida','Reservei um voucher para 5 pessoas. Cada um deve preencher um voucher ou o meu vale para todos?',NULL,'2018-09-29 21:47:53','2018-09-29 21:47:53'),(53,'renata','basic@basicburger.com.br','(11) 3088-3090','Contato Comercial','gistaria de saber como funcikna',NULL,'2018-09-29 23:01:37','2018-09-29 23:01:37'),(54,'Rita De Cássia Bezerra','Santacassiabezerra@gmail.com','(11) 96320-1091','Outro','Boa noite preenchi uma solicitação de voucher fácil para Lentrecote  e coloquei  que vou 