,NULL,'2019-06-06 13:45:36','2019-06-06 13:45:36'),(156,'Camila da Silva Souto de Souza','millasouto10@gmail.com','(11) 9590-586','Outro','Boa noite,\r\nAntes de tudo gostaria de deixar claro que tudo isso ocorreu no restaurante Temakeria & Cia do Shopping Morumbi Town, São Paulo, SP.\r\nO estabelecimento disponibilizou em rede social, a promoção “Desafio do Sushiman” no valor de R$ 79,90 a qual seria aceitar no restaurante somente mediante a apresentação de um voucher que deveria ser gerado pelo próprio site do restaurante. Entretanto, as regras da promoção no site do restaurante deram a entender que cada cliente, independentemente da divisão ou não do “desafio” deveria gerar um voucher individual – ambos para o mesmo dia e hora – e apresentá-lo no momento da compra. Eu e minha acompanhante geramos, ambas, um voucher para o mesmo dia e hora, assim como deu-se a entender que deveria ser feito no site da promoção, e hoje, 07/06/2019, fomos ao restaurante no horário agendado (14:00). Dentro do restaurante, questionamos se realmente era necessária a apresentação dos dois vouchers, uma vez que continuei com certa dúvida, visto que a promoção demonstrava ser necessariamente para duas pessoas, entretanto, foi confirmada pelo atendente a necessidade da apresentação dos dois vouchers. Com isso esclarecido, fizemos o pedido, e quando chegaram os pratos, fiquei novamente confusa, pois chegaram dois pratos, ao invés de somente um. Entendemos então, que por estarmos em duas, eles tinham dividido a comida nos dois pratos, e não conferimos se realmente tinham vindo somente as 50 peças da promoção. Quando pedimos a conta, tivemos uma surpresa, o valor sendo cobrado era de R$ 172,20, pedi então para falar com o gerente, e perguntei o porquê do valor estar diferente do voucher, ele então me disse que foram apresentados 2 vouchers, então a promoção tinha sido cobrada duas vezes. Então eu questionei, visto que o atendente disse que mesmo para 1 promoção, deveriam ser apresentados 2 vouchers diferentes – que também foi o que as regras do site tinham dado a entender – e nesse momento o gerente contradize o atendente, afirmando que a apresentação do voucher era individual. Ele então fez pouco caso do ocorrido, e disse que se eu tivesse alguma reclamação referente à promoção, deveria fazê-la diretamente com “o restaurante”. Gostaria de um posicionamento do restaurante, uma vez que eu, gestante, tive que passar por esse constrangimento, chegando ao ponto de ter que pegar dinheiro emprestado para pagar, visto que tinha levado somente a quantidade necessária para pagar a promoção. Em momento algum o gerente se propôs a resolver o problema gerado pela própria ambiguidade de promoção, demonstrando não somente falta de profissionalismo, mas um desrespeito com seus clientes.\r\nEspero desde já, no mínimo um esclarecimento.\r\nGrata, Camila.',NULL,'2019-06-08 13:15:58','2019-06-08 13:15:58'),(157,'Tainara de Oliveira de souza','tayynara2008@hotmail.com','(19) 98224-1393','Outro','cancelamento',NULL,'2019-06-10 15:27:49','2019-06-10 15:27:49'),(158,'Renan','renan.barcellos@br.ey.com','(11) 95816-6421','Outro','Boa tarde, estou decastradando por motivo que sou de SP capital',NULL,'2019-06-10 15:53:35','2019-06-10 15:53:35'),(159,'Monica do nascimento Castro','admribeirao.ldp@gmail.com','(16) 98192-2100','Contato Comercial','queria trabalhar com voucher facil em minha unidade de ribeirão preto',NULL,'2019-06-13 21:51:17','2019-06-13 21:51:17'),(160,'Eric','eric@talkwithcustomer.com','416-385-3200','Outro','Hello,\r\n\r\nLet’s take a quick trip to Tomorrow-land.\r\n\r\nI’m not talking about a theme park, I’m talking about your business’s future…\r\n\r\nDon’t worry, we won’t even need a crystal ball.  \r\n\r\nJust imagine…\r\n\r\n… a future where the money you invest in driving traffic to your voucherfacil.com.br site pays off with tons of calls from qualified leads. \r\n\r\nAnd the difference between what you experienced in the past is staggering – you’re seein