\n<p>- 150g de chocolate puro derretido</p>\n<br />\n<p><strong>QUANTO? De R$ 35,00 POR R$ 21,00!</strong></p>\n<p>E para ganhar o desconto, é muito fácil:</p>\n<p>1 - Preencha o formulário ao lado;</p>\n<p>2 - Gere seu Voucher Fácil gratuitamente;</p>\n<p>3 - Compareça na loja Castelo do Chocolate, em Capivari, na data agendada;</p>\n<p>4 - Mostre o seu Voucher (impresso ou no celular) e aproveite seu MiniFondue 40% OFF!</p>\n<br />\n<p><strong>Conheça a loja Cacau de Campos</strong></p>\n<p>Qualidade e conforto você encontra aqui! A Cacau de Campos é a única loja de Campos do Jordão que além de oferecer seus deliciosos chocolates, possui uma estrutura com café & sobremesas e estacionamento próprio para os clientes. Temos um aconchegante espaço interno e externo para você aproveitar deliciosos momentos com a sua família e amigos. Somos pet friendly :) Aguardamos sua visita!</p>\n<br />\n<p><strong>Importante:</strong></p>\n<p>Confira a lista de unidades participantes da oferta na seleção de Unidades do Formulário!</p>\n<p>Sujeito à disponibilidade de data e horário. Preencha o formulário para retirar seu Voucher e consultar as datas disponíveis para agendamento.</p>\n<p><strong>Promoção não cumulativa.</strong></p>',NULL,NULL,NULL,'CDC','2022-11-28 21:00:00','2023-01-31 21:00:00','2022-11-28 21:00:00','Individual','Horário Comercial','Preencha o formulário escolhendo o dia em que você deseja o obter seu desconto!',100,'https://app.voucherfacil.com.br/storage/cacau-de-campos/capivari-40-off-mini-fondue/banner-750x420.png','Que tal curtir o Mini Fondue mais gostoso de Campos do Jordão com 30% OFF? É só na loja Cacau de Campos! Pegue seu Voucher Fácil e resgate seu Mini Fondue com desconto!','voucher facil, voucher cacau de campos, mini fondue, mini fondue desconto, chocolate campos do jordao, fondue campos do jordao, chocolate capivari, voucher campos do jordao',NULL,NULL,'1','2022-11-29 18:48:11',NULL,'1',100,3500,2100,NULL,NULL,1,0,'0',NULL);
